import React from "react";

export const Footer = () => {
  return (
    <section>
      <div className="">
                <img
                    className=""
                    src="/treaty-png-1.svg"
                    alt=""
                />
            </div>
            <ul className="list-none md:list-[url('../public/Check-icon-1.png')]">
                <li>Item 1</li>
                <li>Item 2</li>
                <li>Item 3</li>
                </ul>
    </section>
  );
};
